import React from "react";
import Writenote from "./Writenote";
import notes from "../notes";
function Note()
{   console.log(notes);

     return <div>{notes.map((note)=> <Writenote 
        title={note.title}
        body={note.content} 

        />)}</div>
    } 
export default Note;
